def twos_complement_count(a: int, b: int) -> int:

    def gen(num: str) -> int:
        if num == '':
            return 0
        elif num == '1':
            return 1
        elif num == '0':
            return 0
        elif num[0] == '0':
            return gen(num[1:])
        else:
            return int(num[1:], 2) + 1 + gen(num[1:]) + 2 ** (len(num) - 2) * (len(num) - 1)
    if a < 0 or b >= 0:
        if a + b + 1 == 0:
            return 32 * (b + 1)
        elif a + b + 1 < 0:
            return 32 * (b + 1) + twos_complement_count(a, -(b + 2))
        else:
            return 32 * -a + twos_complement_count(-a, b)
    elif a < 0 and b < 0:
        return 32 * (b - a + 1) - twos_complement_count(-b - 1, -a - 1)
    else:
        if a == 0:
            return gen(bin(b)[2:])
        return gen(bin(b)[2:]) - gen(bin(a - 1)[2:])

